import React from 'react';

function Header() {
    const client = "programmer";
    const title = {
        design : "Design",
        programming : "Programming"
    }
    const info = {
        name : "Nour",
        nick : "Homsi"
    }
    return(
        <div class = "navbar bg-black rounded text-white">
            Hello {info.name + ' ' + info.nick}
            <h1 className = "text-white center"> {client === "designer" ? title.design : title.programming} Is My Life </h1>
        </div>
    );
}

export default Header;
